/**
 * @param {number[][]} grid
 * @return {number[][]}
 */
var constructProductMatrix = function(grid) {
    const n = grid.length, m = grid[0].length;
    let p = new Array(n).fill(0).map(() => new Array(m).fill(1));
    const mod = 12345;

    // Temporary arrays to store prefix and suffix products for each row and column
    let rowPrefix = new Array(m).fill(1);
    let rowSuffix = new Array(m).fill(1);
    let colPrefix, colSuffix;

    for (let i = 0; i < n; i++) {
        // Reset prefix and suffix products for this row
        rowPrefix.fill(1);
        rowSuffix.fill(1);

        for (let j = 1; j < m; j++) {
            rowPrefix[j] = (rowPrefix[j - 1] * grid[i][j - 1]) % mod;
        }

        for (let j = m - 2; j >= 0; j--) {
            rowSuffix[j] = (rowSuffix[j + 1] * grid[i][j + 1]) % mod;
        }

        for (let j = 0; j < m; j++) {
            p[i][j] *= rowPrefix[j] * rowSuffix[j] % mod;
        }
    }

    for (let j = 0; j < m; j++) {
        // Reset prefix and suffix products for this column
        colPrefix = new Array(n).fill(1);
        colSuffix = new Array(n).fill(1);

        for (let i = 1; i < n; i++) {
            colPrefix[i] = (colPrefix[i - 1] * grid[i - 1][j]) % mod;
        }

        for (let i = n - 2; i >= 0; i--) {
            colSuffix[i] = (colSuffix[i + 1] * grid[i + 1][j]) % mod;
        }

        for (let i = 0; i < n; i++) {
            p[i][j] = p[i][j] * colPrefix[i] * colSuffix[i] % mod;
        }
    }

    return p;
};
